function MatchReplay(props) {
    const data = props.data
    return (
        <div className="flex flex-col p-4 bg-white brd rounded-lg">
            <div className="text-lg font-medium">Match Highlights</div>
            <div className="w-full h-60 flex items-center justify-center bg-black rounded-lg">
                <img src={data.image} className="h-60 object-contain" alt="videoThumbnail"></img>
            </div>
        </div>
    )
}

export default MatchReplay
